import React from 'react';
import styled from 'styled-components';
const Card = ({ title, children }) => {
  const Background = styled.div`
    background-color: skyblue;
    height: 100px;
    width: 100px;
  `;
  return (
    <>
      <Background>
        <h1>{title}</h1>
        {children}
      </Background>
    </>
  );
};

export default Card;
